import { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import './Dashboard.css';

function Dashboard() {

    const [values, setValues] = useState();
    const navigate = useNavigate();
    useEffect(
        () => {
            fetch("http://localhost:3333"+"/dashboard", {
                method: "POST",
                credentials: "include",
                headers: {
                    "Content-Type" : "application/json"
                }
            })
            .then(res => res.json())
            // .then(res => console.log(res))
            .then(res => setValues(JSON.stringify(res)))
            .catch(()=> {
                navigate('/')
            })
        }, []
    );

    const onTabClick = () => {

    }
    return (
        <div className="">
            <div className="container-fluid d-flex">
            <div className="row mt-3">
            <div className="col-3">
                    <div className="container">
                        <button className="container btn-primary d-block" id="search" onClick={onTabClick}>Gallery</button>
                        <button className="container btn-primary d-block" id="account" onClick={onTabClick}>Favourites</button>
                        <button className="container btn-primary d-block" id="order" onClick={onTabClick}>Logout</button>
                    </div>
                </div>
                <div className="col-8">
                    {
                    }
                </div>
            </div>            
            </div>
           
        </div>
    )
}
export default Dashboard;
